	worker = new Worker(URL.createObjectURL(new Blob([`
(() => {
	var util = (${bundle})(),
		full_obj = (obj, seen = []) => Array.isArray(obj) ? obj.map(serialize) : Object.fromEntries(Object.getOwnPropertyNames(obj).map(key => {
			var add = [ key, obj[key] ];
			
			if(typeof obj[key] == 'object' && obj[key]){
				if(obj[key] == obj || seen.includes(obj[key])){
					var found = seen.find(x => x[1] == obj[key]);;
					
					add[1] = found ? found[1] : null;

				object: typeof data == 'object' && data ? full_obj(data) : {},
				constructor: typeof data == 'object' && data && data.constructor ? data.constructor.name : 'null',
				__serialized: true,
			};
		};
	
	console.result = () => {};
	
	['debug', 'error', 'info', 'log', 'warn', 'dir', 'dirxml', 'table', 'trace', 'group', 'groupCollapsed', 'groupEnd', 'clear', 'count', 'countReset', 'assert', 'profile', 'profileEnd', 'time', 'timeLog', 'timeEnd', 'timeStamp', 'context', 'result'].forEach(key => (console['_' + key] = console[key].bind(console), console[key] = (...data) => {

	input_ind = 0;

worker.postMessage(`
console.log([ true, false, 'x', { test: true } ]);

console.log({
	// work on getters soon
	thiss: 'is a demo',
	array: ['value1', true, 1, 'value4'],
});
`);

input.addEventListener('keydown', event => {
	switch(event.key){
		case'Tab':
		
			event.preventDefault();
			
			var start = input.selectionStart, end = input.selectionEnd;
			
			input.value = input.value.substr(0, input.selectionStart) + '\t' + input.value.substr(input.selectionStart);
			
			input.selectionStart = start + 1;
			input.selectionEnd = end + 1;
			
			break;
		case'Enter':
		
			if(input.value && !event.shiftKey){
				event.preventDefault();
				
				stored_inputs.push(input.value);
				input_ind++;
				
				worker.postMessage(input.value);
				input.value = '';
			}
			
			break;
	}
});

worker.addEventListener('message', event => {
	var log = {
			con: add_ele('div', output, { className: 'log ' + event.data.type }),
		},
		proc_obj = (parent, data) => {
			var array = Array.isArray(data.object),
				obj_con = add_ele('div', parent, { className: 'obj preview' + (array ? ' array' : '') }),
				toggle = add_ele('div', obj_con, { className: 'toggle' });
			
			toggle.addEventListener('click', () => obj_con.classList.toggle('preview'));
			
			add_ele('div', obj_con, { className: 'brace', textContent: array ? '[' : '{' });
			
			Object.entries(data.object).forEach(([ key, val ]) => {
				if(obj_con.prev)add_ele('div', obj_con.prev.value, { className: 'seperator', innerHTML: ',' });
				
				var entry = obj_con.prev = {
					con: add_ele('div', obj_con, { className: 'entry' }),
				}
				
				// if(!array)
				// only show index when not previewed soon
				entry.key = add_ele('div', entry.con, { className: 'key', textContent: key });
				
				entry.value = add_ele('div', entry.con, { className: 'value' });
				
				if(val.type == 'object')return proc_obj(entry.value, val);
				
				entry.value.className = val.type;
				entry.value.textContent = val.json;
			});
			
			add_ele('div', obj_con, { className: 'brace', textContent: array ? ']' : '}' });
		};
	
	event.data.data.forEach(data => {
		if(data.constructor.includes('Error') || data.constructor == 'String' || data.type == 'string')data.type = 'string';
		
		var scroll = log.con.scrollTop >= (log.con.scrollHeight - log.con.offsetHeight);
		
		switch(data.type){
			case'object':
				
				proc_obj(log.con, data);
				
				break;
			default:
				
				log.text = add_ele('div', log.con, { className: 'text ' + data.type, textContent: data.string });
				
				break;
		}
		
		if(scroll)log.con.scrollTop = log.con.scrollHeight;
	});
	
	// log.innerHTML = log.innerHTML.replace(regex.link, match => (temp.push({ className: 'link', href: match }), '<a data-temp="' + (temp.length - 1) + '">' + match + '</a>'));
	
	// [...log.querySelectorAll('[data-temp]')].forEach(node => Object.assign(node, temp[node.dataset.temp]));
	
	if(event.data.trace)add_ele('div', log, { textContent: event.data.trace, className: 'link trace' });
});
